(47,'Advanced Basic Materials Wholesale','You will study the major concepts and modes of inquiry from the social studies—the integrated study of history, geography, the social sciences, and other related areas—to promote elementary students’ abilities to make informed decisions as citizens of a culturally diverse democratic society and interdependent world. Instructional approaches and assessment tools will be demonstrated and applied in field experiences. You will learn to develop valid teacher made tests in relation to unit and lesson planning. Fieldwork (8 hours) is required.','Eastern Time (US & Canada)',11,'2021-08-28 04:00:00','2021-12-11 04:59:00','2021-08-04 01:19:04','2023-01-11 21:46:26','IST-676','Advanced Basic Materials Wholesale','IST-676',NULL,-16243165),
